import React, { useEffect } from "react";
import { useState } from "react";

const ShowExams = () => {
  const [data, setData] = useState("");
  const [examid, setexamid] = useState("");
  const [examname, setexamname] = useState("");
  const [description, setdescription] = useState("");
  const [creationdate, setcreationdate] = useState("");
  const [expirationdate, setexpirationdate] = useState("");
  const [noofquestions, setnoofquestions] = useState("");
  const [durationminutes, setdurationminutes] = useState("");
  const [passpercentage, setpasspercentage] = useState("");
  const [questionsrandomized, setquestionsrandomized] = useState("");
  const [answersmust, setanswersmust] = useState("");
  const [enablenegativemark, setenablenegativemark] = useState("");
  const [negativemarkvalue, setnegativemarkvalue] = useState("");

  async function fetchInfo() {
    console.log("fetch obj is called....");

    const response = await fetch(
      "https://localhost:8443/onlineexam/control/examMasterListEvent"
    );
    // if(response.status === "success"){
    const text = await response.json();
    // console.log("--------",response.json());
    // console.log("-------examData-",text.examData);
    // console.log("-------examData-",response.status);

    //  let obj=JSON.stringify(text.examData);
    //  console.log(obj);

    // }
    //  const text = await response.examData();
    // const datas = JSON.parse(text.substring(2));
    // console.log("--------",text);

    setData(text.examData);
      console.log("myexamdata..",data.examId);
   
  }

  useEffect(() => {
    fetchInfo();
  }, []);

  return (
      <div className="container">
      <div className="col-8">
        <table className="table table-striped">
          <thead>
            <tr>
              <th>ExamId</th>
              <th>ExamName</th>
              {/* <th>Description</th> */}
              <th>CreationDate</th>
              <th>ExpirationDate</th>
              <th>No of Questions</th>
              <th>Duration Minutes</th>
              <th>Pass Percentage</th>
              <th>Questions Randomized</th>
              {/* <th>Answers Must</th> */}
              {/* <th>Enable negative Mark</th> */}
              <th>Negative Mark value</th>
            </tr>
          </thead>

          <tbody>
            {data
              ? data.map((obj, value) => (
                  <tr>
                    <td>{obj.examId}</td>
                    <td>{obj.examName}</td>
                    {/* <td>{obj.description}</td> */}
                    <td>{obj.creationDate}</td>
                    <td>{obj.expirationFate}</td>
                    <td>{obj.noOfQuestions}</td>
                    <td>{obj.durationMinutes}</td>
                    <td>{obj.passPercentage}</td>
                    <td>{obj.questionsRandomized}</td>
                    {/* <td>{obj.answersMust}</td> */}
                    {/* <td>{obj.enableNegativeMark}</td> */}
                    <td>{obj.negativeMarkValue}</td>
                    <td>
                      <button className="btn btn-primary">Edit</button>
                    </td>
                    <td>
                      <button className="btn btn-danger">Delete</button>
                    </td>
                  </tr>
                ))
              : ""}
          </tbody>
        </table>
      </div>
      </div>

  );
};
export default ShowExams;
